import { Title } from '../Styled'
import SongRow from './SongRow';
import './style.scss'
function Songs(props) {
  const songList = props.songs;

  return (
    <div className="container">
      <Title padding='10px 0'>Trending Right Now:</Title>
      <div className="songs">
        <tbody>
          <tr>
            <th>#</th>
            <th>Name Song</th>
            <th>Artist</th>
            <th>Time</th>
          </tr>
          {song}
            <SongRow />
        </tbody>
      </div>
    </div>
  );
}

export default Songs
